script: |
  super -f tsv -I q10201.sql | sort > q10201.out

vector: true

inputs:
  - name: q10201.sql
    data: |
      pragma pg
      SELECT ALL - col2 AS col2 FROM tab2 GROUP BY col2 HAVING NOT NULL NOT BETWEEN + col2 * col2 + 13 AND - 70 * col2;
  - name: tab2

outputs:
  - name: q10201.out
    data: |
